  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:44.835115\",\n\t\"name\": \"baseline-contaminant-survey-of-the-missouri-river-in-missouri\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Inorganic Contaminants The following metals
  were determined to be at or below the detection limit in the fish samples: beryllium,
  boron, cadmium, lead, molybdenum, and nickel. The metal residue concentrations above
  the detection limit in tissue samples collected from the Missouri River can be found
  in Table 1. Sediment sample residue concentrations for metals at concentrations
  above the detection limit can be found in Table 2. Molybdenum was the only element
  determined to be at or below the detection limit in the sediment samples. Organic
  Contaminants The fish tissue residue concentrations of aldrin, endrin, hexachlorobenzene,
  a -BHC, b -BHC, G-BHC, d -BHC, toxaphene, arochlors 1242 and 1248, and mirex were
  at or below the lower level of detection. Residue concentrations of the remaining
  organo-chlorine compounds found in common carp from the Missouri River are in Table
  3. None of the organochlorine compounds were found in levels above the detection
  limits in the sediment samples. Residue concentrations of aliphatic hydrocarbon
  compounds in common carp tissues can be found in Table 4. The only sediment samples
  containing residue levels above the lower level of detection were from the Glasgow
  sample site. Sample # 1 contained 0.13 ppm n-heptadecane and Sample #2, 0.16 ppm
  n-heptadecane (wet weight), all other compounds were below the detection limit.
  Polynuclear aromatic hydrocarbon compounds were not detected significantly above
  the lower level of detection in the fish tissue or sediment samples collected for
  this study.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
